import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Exercice1 from './components/Exercice/exos/Exo1';
import Result from './components/Listes/Result';
import FilmItem from './components/Exercice/exos/Exo2';
import Calculatrice from './components/Exercice/calculatrice/calculatrice';
const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Accueil">
        <Stack.Screen name="Accueil" component={Calculatrice} /> 
        <Stack.Screen name="Product Navigation" component={FilmItem} /> 
        <Stack.Screen name="Product Details" component={Result} /> 
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
